import { useNavigate } from "react-router-dom";
import "./BotaoPrecisao.css";

function BotaoPrecisao(props) {
  const navigate = useNavigate();
  return( <div className="BotaoPrecisao">
   <button  onClick={()=>{
                navigate(props.localVolta, {state:{data:props.dadosVolta}})
            }}>
              <img  className="reverse" src="../Imagens/SetaLado" alt=""/></button> <img className= "Lupa" src="../Imagens/Lupa" alt=""/> 
              <button  onClick={()=>{
                navigate(props.localIda, {state:{data:props.dadosIda}})
            }}><img src="../Imagens/SetaLado" alt=""/></button> 
  </div>
  )
}
export default BotaoPrecisao;
